import { useState, useEffect } from "react"

export default function Products() {

    let [data, setdata] = useState([])

    let getData = async () => {

        let res = await fetch(`https://fakestoreapi.com/products/`)
        let data = await res.json()
        setdata(data)
        console.log(data)

    }




    useEffect(() => {
        getData()

    }, [])


    return (
        <div></div>
    )
}
